import React, { useState, useEffect } from "react";
import Header from "../components/Header"; // Import Header component

const addToCart = async (productId) => {
  try {
    const response = await axios.post(
      "http://localhost:7001/api/cart/add",
      { productId, quantity: 1 },
      {
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${localStorage.getItem("token")}`, // Ensure user authentication
        },
      }
    );

    alert(response.data.message || "Product added to cart!");
  } catch (error) {
    /* eslint-disable */console.error(...oo_tx(`693682883_19_4_19_57_11`,"Error adding product to cart:", error));
    alert("Failed to add product to cart.");
  }
};
const Shop = () => {
  const [products, setProducts] = useState([]);
  const [loading, setLoading] = useState(true);


  useEffect(() => {
    const fetchProducts = async () => {
      try {
        const response = await fetch("http://localhost:7001/api/auth/product");
        const data = await response.json();
        setProducts(data);
      } catch (error) {
        /* eslint-disable */console.error(...oo_tx(`693682883_35_8_35_56_11`,"Error fetching products:", error));
      } finally {
        setLoading(false);
      }
    };

    fetchProducts();
  }, []);

  return (
    <div className="m-0 font-sans">
      <Header /> {/* Navbar/Header */}
      <div className="p-5  text-center">
        <h2 className="text-2xl font-bold mb-6 text-gray-800 relative inline-block">
          Shop Our Plants
          <span className="block w-16 h-[3px] bg-gray-800 mx-auto mt-3"></span>
        </h2>
        {loading ? (
          <p className="text-center text-gray-600">Loading products...</p>
        ) : products.length > 0 ? (
          <div className="grid grid-cols-2 sm:grid-cols-2 md:grid-cols-3 lg:grid-cols-4 gap-5 max-w-5xl mx-auto">
            {products.map((product) => (
              <div
                key={product._id}
                className="bg-white border border-gray-300 rounded-lg shadow-md p-4 flex flex-col"
              >
                {/* Product Image */}
                <img
                  src={product.image}
                  alt={product.title}
                  className="w-full h-[180px] object-cover rounded-md mb-4"
                />

                {/* Product Title */}
                <h4 className="text-lg font-bold text-center mb-2">
                  {product.title}
                </h4>

                {/* Price and Add to Cart Button */}
                <div className="flex justify-between items-center">
                  {/* Product Price */}
                  <p className="text-gray-600 text-lg font-semibold">
                    {product.price}
                  </p>

                  {/* Add to Cart Button */}
                  <button
                    onClick={() => addToCart(product._id)} // Call function on click
                    className="bg-green-500 text-white rounded-md px-4 py-2 hover:bg-green-600"
                    aria-label={`Add ${product.title} to cart`}
                  >
                    +
                  </button>
                </div>
              </div>
            ))}
          </div>
        ) : (
          <p className="text-center text-gray-600">No products found.</p>
        )}
      </div>
    </div>
  );
};

export default Shop;
